    false,nt"url": null,nt"notes": "Physical, current, and other data were
    collected from CTD and current meters from FIXED PLATFORMS from Coastal Waters of
    Washington/Oregon and other locations from 01 August 2000 to 29 August 2000. Data
    were collected by the Pacific Marine Environmental Laboratory (PMEL) in support
    of the Fisheries-Oceanography Cooperative Investigations (FOCI) project. CTD data
    include temperature, conductivity, and salinity. Current meter data include East/West
    velocity components (U), North/South velocity component (V), temperature, pressure,
    conductivity, sound velocity, instantaneous heading, instantaneous pitch, instantaneous
    roll, and turbidity. Data are not in standard formats but are self documenting.",nt"owner_org":
